import { Center } from "@chakra-ui/react";
import Link from "next/link";

export default function Navbar() {
	return (
		<Center p={5}>
			<Link href="/">
				<a>Home</a>
			</Link>
			<Link href="/">
				<a>Contact</a>
			</Link>
			<Link href="/">
				<a>About</a>
			</Link>
		</Center>
	);
}
